import React from 'react';
import '../styles/App.scss';
import '../index.scss';


import Header from './Header';
import About from './projects/About'


import { Route, Switch } from 'react-router-dom';

const App = () => (
  <div className="App">
    <Switch>
      <Route exact path="/">
        <Header/>
      </Route>

    <Route exact path="/about">
        <About/>
     </Route> 

     <Route exact path="/codeProjects">
        <About/>
     </Route> 

  </Switch>
</div>
)

export default App;
